import React from 'react';
import { Link } from 'react-router-dom';
import Nav from "./Nav.js";

export function About(){
    return (
        <>
            <Nav />
        </>
    )
}

export function Profile(){
    return (
        <div>
            <Link to="/About">About</Link>
            <Link to="/">Home</Link>
            <Link to="/Profile">Profile</Link>
        </div>
    )
}

function Home(){
    return (
        <div>
            <Link to="/About">About</Link>
            <Link to="/">Home</Link>
            <Link to="/Profile">Profile</Link>
        </div>
    )
}


export function App(){
    return (
        <div>
            <Home />
        </div>
    )
}
